import React from "react";
import { ComposedChart, Bar, XAxis, YAxis, Tooltip } from "recharts";

const aData = [
  {
    days: 30,
    PuppyBar: "0-1Puppy",
  },
  {
    days: 85,
    PuppyBar: "2-6Adult",
  },
  {
    days: 103,
    PuppyBar: "7+Senior",
  },
];

export default function Adopt() {
  return (
    <ComposedChart
      layout="vertical"
      width={350}
      height={160}
      data={aData}
      margin={{
        top: 0,
        right: 20,
        bottom: 20,
        left: 20,
      }}
    >
      <XAxis type="number" />
      <YAxis
        dataKey="puppyBar"
        type="category"
        scale="band"
        interval={"preserveStartEnd"}
      />
      <Tooltip />
      <Bar dataKey="days" barSize={7} fill="rgb(78, 210, 220)" />
    </ComposedChart>
  );
}
